INSERT INTO `frontend_settings` VALUES (1,'banner_title','Apprenez à votre rythme'),(2,'banner_sub_title','Étudiez n&#039;importe quel sujet, n&#039;importe quand. Explorez des milliers de cours au prix le plus bas jamais proposé !'),(4,'about_us','<p></p><h2><span xss=\"removed\">A propos de nous </span></h2><p><span xss=\"removed\">Bienvenue à l\'académie Éduc-pro. Cela vous aidera à apprendre d\'une nouvelle manière</span></p>'),(10,'terms_and_condition','<h2>Terms and Condition</h2><h3><span xss=\"removed\">I-Conditions générales d\'utilisation</span></h3><h5><i xss=\"removed\"><span xss=\"removed\">La dernière mise à jour des présentes Conditions générales d\'utilisation (</span><span xss=\"removed\">« Conditions »</span><span xss=\"removed\">) </span></i>date du<i xss=\"removed\"><span xss=\"removed\"> </span></i><span xss=\"removed\">4 mars  2022</span><i xss=\"removed\"><span xss=\"removed\">.</span></i></h5><h5><p class=\"MsoNormal\" xss=\"removed\"><span xss=\"removed\">1. Comptes<o></o></span></p><p class=\"MsoNormal\" xss=\"removed\"><span xss=\"removed\">Vous avez besoin d\'un compte pour la plupart des activités relatives à notre plate-forme. Conservez votre mot de passe dans un lieu sûr, car vous êtes responsable de toute activité associée à votre compte. Si vous pensez que quelqu\'un d\'autre utilise votre compte sans votre autorisation, faites-le-nous savoir en contactant notre </span><u><span xss=\"removed\">Équipe Support</span></u><span xss=\"removed\">. Pour utiliser Educ-pro Academy, vous devez avoir l\'âge minimal requis dans votre pays pour l\'inscription à des services en ligne.</span></p><p class=\"MsoNormal\" xss=\"removed\"><span xss=\"removed\">Vous avez besoin d\'un compte pour la plupart des activités de notre plate-forme, y compris pour acheter et accéder à du contenu ou pour soumettre du contenu à des fins de publication. Lorsque vous configurez votre compte, vous devez fournir des informations exactes et complètes, y compris une adresse e-mail valide, et vous devez ensuite mettre à jour régulièrement votre compte afin que ces informations restent exactes et complètes. Vous avez l\'entière responsabilité de votre compte et de tout ce qui s\'y passe, y compris de tout préjudice ou dommage causé (à nous ou à quiconque) par un tiers utilisant votre compte sans votre autorisation. Cela signifie que vous devez faire très attention à votre mot de passe. Vous ne pouvez pas transférer votre compte à quelqu\'un d\'autre ni utiliser le compte d’un tiers. Si vous nous contactez pour obtenir l\'accès à un compte, nous ne répondrons favorablement à votre demande qu\'une fois que vous nous aurez transmis les informations requises prouvant que vous êtes le propriétaire de ce compte. En cas de décès d\'un utilisateur, son compte sera fermé.<o></o></span></p><p class=\"MsoNormal\" xss=\"removed\"><span xss=\"removed\">Vous n\'êtes pas autorisé à partager vos identifiants de connexion à votre compte avec quiconque. Vous êtes responsable de ce qui se passe sur votre compte et Educ-pro Academy n\'interviendra pas dans les litiges entre participants ou formateurs. Dès que vous suspectez qu’un tiers utilise votre compte sans votre autorisation (ou suspectez toute autre infraction à la sécurité), vous devez nous en informer en contactant notre </span><u><span xss=\"removed\">Équipe de support</span></u><span xss=\"removed\">. Nous pouvons vous demander des informations supplémentaires afin de vérifier que vous êtes bien le titulaire du compte en question.<o></o></span></p><p class=\"MsoNormal\" xss=\"removed\"><span xss=\"removed\">Les participants et les formateurs doivent avoir au moins 18 ans pour créer un compte sur Educ-pro Academy et utiliser les Services. Si vous avez moins de 18 ans, mais que vous avez l\'âge requis pour accepter l\'utilisation de services en ligne dans votre pays </span><span lang=\"FR\" xss=\"removed\">,</span><span xss=\"removed\">vous ne pouvez pas configurer de compte, mais nous vous encourageons à demander à un parent ou à un représentant légal d\'ouvrir un compte et de vous aider à accéder aux contenus appropriés. Si vous n\'avez pas l\'âge d\'accepter l\'utilisation de services en ligne, vous ne pouvez pas créer de compte Educ-pro Academy. Si nous découvrons que vous avez créé un compte qui enfreint ces règles, nous le fermerons. Selon nos </span><u><span xss=\"removed\">Conditions d\'utilisation du formateur</span></u><span xss=\"removed\">, il peut vous être demandé de justifier votre identité avant de pouvoir soumettre du contenu destiné à être publié sur Educ-pro Academy.<o></o></span></p><p class=\"MsoNormal\" xss=\"removed\"><span xss=\"removed\">Vous pouvez fermer votre compte à tout moment en suivant la procédure décrite </span><u><span xss=\"removed\">ici</span></u><span xss=\"removed\">. Consultez notre </span><u><span xss=\"removed\">Politique de confidentialité</span></u><span xss=\"removed\"> pour savoir ce qui se passe lorsque vous supprimez votre compte.<o></o></span></p><p class=\"MsoNormal\" xss=\"removed\"><span xss=\"removed\">2. Inscription aux contenus et accès illimité<o></o></span></p><p class=\"MsoNormal\" xss=\"removed\"><span xss=\"removed\">Lorsque vous vous inscrivez à un cours ou tout autre contenu, vous obtenez une licence de notre part pour y accéder par le biais des Services Educ-pro Academy et uniquement à cette fin. N\'essayez pas de transférer ou de revendre du contenu de quelque façon que ce soit. Nous vous accordons généralement une licence d\'accès illimité, sauf dans le cas où nous devrions désactiver le contenu pour des raisons de conflit avec la législation ou nos politiques ou pour des inscriptions via des Plans d\'abonnement.<o></o></span></p><p class=\"MsoNormal\" xss=\"removed\"><span xss=\"removed\">Selon nos </span><u><span xss=\"removed\">Conditions d\'utilisation du formateur</span></u><span xss=\"removed\">, lorsqu\'un formateur publie du contenu sur Educ-pro Academy, il accorde à Educ-pro Academy une licence nous permettant d\'accorder nous-mêmes aux participants une licence d\'accès au contenu. Cela signifie que nous avons le droit d\'accorder une sous-licence d\'accès au contenu aux participants inscrits. Lorsqu\'un participant s\'inscrit à un cours ou autre contenu, qu\'il s\'agisse d\'un contenu gratuit ou payant, il obtient une licence d\'Educ-pro Academy pour accéder à ce contenu via la plate-forme et les Services Educ-pro Academy, et Educ-pro Academy en est le concédant. Le contenu vous est fourni sous licence ; il ne vous est pas vendu. Cette licence ne vous donne en aucun cas le droit de revendre le contenu de quelque manière que ce soit (y compris en partageant les informations du compte avec un acheteur ou en téléchargeant illégalement le contenu et en le partageant ensuite sur des sites de téléchargement illégal).<o></o></span></p><p class=\"MsoNormal\" xss=\"removed\"><span xss=\"removed\">En des termes juridiques plus complets, Educ-pro Academy vous accorde (en tant que participant) une licence limitée, non exclusive, non transférable pour accéder et consulter le contenu pour lequel vous vous êtes acquitté de tous les frais requis, uniquement à des fins personnelles, non commerciales et pédagogiques via les Services, conformément aux présentes Conditions et à toute condition ou restriction associée à un contenu spécifique ou à une fonctionnalité spécifique de nos Services. Toute autre utilisation est formellement interdite. Vous n\'avez pas le droit de reproduire, redistribuer, transmettre, céder, vendre, diffuser, louer, partager, prêter, modifier, adapter, éditer, ou autrement transférer ou utiliser un quelconque contenu ni créer des œuvres dérivées ou accorder une sous-licence de celui-ci sans avoir reçu une autorisation explicite de notre part à cet effet, sous forme écrite et signée par un représentant habilité d\'Educ-pro Academy. Cela s\'applique également au contenu auquel vous pouvez accéder via l\'une de nos API.<o></o></span></p><p class=\"MsoNormal\" xss=\"removed\"><span xss=\"removed\">Nous accordons généralement une licence d\'accès illimité à nos participants lors de leur inscription à un cours ou autre contenu. Toutefois, nous nous réservons le droit à tout moment de révoquer toute licence permettant l\'accès à tout contenu et son utilisation, dans l’éventualité où nous déciderions ou serions tenus de désactiver l\'accès à ce contenu pour des raisons de conflit avec la législation ou nos politiques. Cela peut être le cas, par exemple, si le cours ou autre contenu auquel vous vous êtes inscrit fait l\'objet d\'une plainte pour atteinte aux droits d\'auteur ou si nous estimons que son contenu va à l\'encontre de nos </span><u><span xss=\"removed\">Directives sur la confiance et la sécurité</span></u><span xss=\"removed\">. Cette licence d\'accès illimité ne s\'applique pas aux fonctionnalités et services complémentaires associés au cours ou autre contenu auquel vous vous inscrivez. Par exemple, un formateur peut décider à tout moment de ne plus fournir de services de questions-réponses ou d\'assistance d\'enseignement en lien avec son contenu. En d\'autres termes, l\'accès illimité s\'applique au contenu du cours, mais est tributaire du formateur.<o></o></span></p><p class=\"MsoNormal\" xss=\"removed\"><span xss=\"removed\">Un formateur ne peut pas accorder de licences d\'accès à son contenu à des participants directement. Une telle licence directe sera déclarée nulle et non avenue et représente une violation des présentes Conditions.<o></o></span></p><p class=\"MsoNormal\" xss=\"removed\"><o> </o></p></h5><h1 xss=\"removed\"><span xss=\"removed\">II-Conditions d\'utilisation du formateur</span></h1><h5><span xss=\"removed\">La dernière mise à jour des présentes Conditions d\'utilisation du formateur date du 4 mars  2022.</span></h5><h5><span xss=\"removed\"><br></span><span lang=\"fr\" xss=\"removed\">Lorsque vous vous inscrivez pour devenir formateur sur la plateforme Educ-Pro Academy, vous acceptez de respecter les présentes conditions pour les formateurs (les \"conditions générales d\'utilisation du formateur\"). Ces conditions couvrent les détails des aspects de la plate-forme Educ-Pro Academy pertinents pour les instructeurs et sont incorporées par référence dans nos </span><span lang=\"fr\"><u><span xss=\"removed\">conditions générales d\'utilisation</span></u></span><span lang=\"fr\" xss=\"removed\">, les conditions générales qui régissent votre utilisation de nos services. Tous les termes en majuscules qui ne sont pas définis dans les présentes conditions sont définis comme spécifiés dans les </span><span lang=\"fr\"><u><span xss=\"removed\">conditions générales d\'utilisation</span></u></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">.</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">En tant qu\'instructeur, vous passez un contrat directement avec Educ-Pro Academy, enterprise enregistrée et domiciliée en République du Bénin.<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">1. Obligations du formateur<br></span></span></b><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span></b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">En tant qu\'instructeur, vous êtes responsable de tout le contenu que vous publiez, y compris les cours, les quiz, les exercices de codage, les tests pratiques, les devoirs, les ressources, les réponses, le contenu de la page d’accueil du cours, les évaluations et les annonces (\"</span><b><span xss=\"removed\">Contenu soumis</span></b><span xss=\"removed\">\").<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Vous déclarez et garantissez que :<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">●</span><span xss=\"removed\">     </span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Vous fournirez et maintiendrez des informations de compte exactes ;</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">●</span><span xss=\"removed\">     </span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Vous possédez ou avez les licences, les droits, les consentements, les permissions et l\'autorité nécessaires pour autoriser Educ-Pro Academy à utiliser votre contenu soumis comme spécifié dans les présentes conditions et les conditions générales d\'utilisation ;</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">●</span><span xss=\"removed\">     </span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Votre contenu soumis n\'enfreindra pas ou ne détournera pas les droits de propriété intellectuelle d\'un tiers ;</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">●</span><span xss=\"removed\">     </span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Vous avez les qualifications, les références et l\'expertise requises (y compris l\'éducation, la formation, les connaissances et les compétences) pour enseigner et offrir les services que vous proposez par le biais de votre contenu soumis et de l\'utilisation des services ; et</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">●</span><span xss=\"removed\">     </span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Vous assurerez une qualité de service correspondant aux normes de votre secteur et des services d\'enseignement en général.</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Vous vous engagez à ne pas :<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">●</span><span xss=\"removed\">     </span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Publier ou fournir tout contenu ou information inapproprié, offensant, raciste, haineux, sexiste, pornographique, faux, trompeur, incorrect, contrefaisant, diffamatoire ou calomnieux ;</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">●</span><span xss=\"removed\">     </span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Afficher ou transmettre toute publicité non sollicitée ou non autorisée, tout matériel promotionnel, tout courrier indésirable, tout spam ou toute autre forme de sollicitation (commerciale ou autre) par l\'intermédiaire des Services ou à tout utilisateur ;</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">●</span><span xss=\"removed\">     </span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Utiliser les Services à des fins commerciales autres que la fourniture de services de tutorat, d\'enseignement et d\'instruction aux participants ;</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">●</span><span xss=\"removed\">     </span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">S’engager dans toute activité qui nous obligerait à obtenir des licences ou à payer des redevances à un tiers, y compris la nécessité de payer des redevances pour l\'exécution publique d\'une œuvre musicale ou d\'un enregistrement sonore ;</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">●</span><span xss=\"removed\">     </span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Usurper l\'identité d\'une autre personne ou obtenir un accès non autorisé au compte d\'une autre personne ;</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">●</span><span xss=\"removed\">     </span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Interférer avec ou empêcher de toute autre manière d\'autres instructeurs de fournir leurs services ou leur contenu ; ou</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">●</span><span xss=\"removed\">     </span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Abuser des ressources d’Educ-Pro Academy, y compris les services d\'assistance.</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">2. Licence à Educ-Pro Academy<br></span></span></b><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span></b><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span></b><span lang=\"fr\" xss=\"removed\">Vous accordez à Educ-Pro Academy les droits détaillés dans les </span><span lang=\"fr\"><u><span xss=\"removed\">conditions générales d\'utilisation</span></u></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> pour offrir, commercialiser et exploiter autrement votre contenu soumis. Cela inclut le droit d\'ajouter des légendes ou de modifier le contenu soumis pour en assurer l\'accessibilité. Vous autorisez également Educ-Pro Academy à sous-licencier ces droits à votre contenu soumis à des tiers, y compris à des étudiants directement et par l\'intermédiaire de tiers tels que des partenaires, des revendeurs, des distributeurs, des sites affiliés, des sites de transactions et des publicités payantes sur des plateformes tierces.</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\">Sauf accord contraire (y compris dans le cadre de notre </span><span lang=\"fr\"><u><span xss=\"removed\">politique de promotion</span></u></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">), vous avez le droit de retirer tout ou partie de votre contenu soumis des services à tout moment. Sauf accord contraire, le droit d’Educ-Pro Academy de sous-licencier les droits dans cette section prendra fin en ce qui concerne les nouveaux utilisateurs 60 jours après le retrait du contenu soumis. Toutefois, (1) les droits accordés aux étudiants avant le retrait du contenu soumis se poursuivront conformément aux conditions de ces licences (y compris toute concession d\'accès à vie) et (2) le droit d’Educ-Pro Academy d\'utiliser ce contenu soumis à des fins de marketing survivra à la résiliation.</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Nous pouvons enregistrer et utiliser tout ou partie de votre contenu soumis pour le contrôle de la qualité et pour la livraison, le marketing, la promotion, la démonstration ou l\'exploitation des Services. Vous accordez à Educ-Pro Academy la permission d\'utiliser votre nom, votre voix et votre image dans le cadre de l\'offre, de la livraison, du marketing, de la promotion, de la démonstration et de la vente de ses services, de votre contenu soumis ou du contenu d’Educ-Pro Academy, et vous renoncez à tous les droits de confidentialité, de publicité ou autres droits de nature similaire, dans la mesure permise par la loi applicable.<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">3. Confiance et sécurité<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> 3.1 Politiques de confiance et de sécurité<br></span></span></b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\">Vous acceptez de respecter les </span><span lang=\"fr\"><u><span xss=\"removed\">politiques de confiance et de sécurité </span></u></span><span lang=\"fr\" xss=\"removed\">d’Educ-Pro Academy, la </span><span lang=\"fr\"><u><span xss=\"removed\">politique des sujets restreints</span></u></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">, et d\'autres normes de qualité du contenu ou des politiques prescrites par Educ-Pro Academy de temps à autre. Vous devez vérifier ces politiques périodiquement pour vous assurer que vous vous conformez à toute mise à jour de celles-ci. Vous comprenez que votre utilisation des services est soumise à l\'approbation d’Educ-Pro Academy, que nous pouvons accorder ou refuser à notre seule discrétion.</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Nous nous réservons le droit de supprimer du contenu, de suspendre les paiements et/ou d\'interdire des instructeurs pour quelque raison que ce soit, à tout moment et sans préavis, y compris dans les cas où :<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">●</span><span xss=\"removed\">     </span></span><span lang=\"fr\" xss=\"removed\">un instructeur ou un contenu ne respecte pas nos politiques ou nos conditions légales (y compris les </span><span lang=\"fr\"><u><span xss=\"removed\">conditions générales d\'utilisation</span></u></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">) ;</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">●</span><span xss=\"removed\">     </span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">la qualité contenu est inférieure à nos normes de qualité ou a un impact négatif sur l\'expérience de l\'étudiant ;</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">●</span><span xss=\"removed\">     </span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">un instructeur adopte un comportement susceptible de donner une image défavorable d’Educ-Pro Academy ou de porter Educ-Pro Academy au discrédit public, au mépris, au scandale ou au  ridicule ;</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">●</span><span xss=\"removed\">     </span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">un instructeur fait appel aux services d\'un spécialiste du marketing ou d\'un autre partenaire commercial qui viole les politiques d’Educ-Pro Academy ;</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">●</span><span xss=\"removed\">     </span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">un instructeur utilise les services d\'une manière qui constitue une concurrence déloyale, comme la promotion de son entreprise hors site d\'une manière qui viole les politiques d’Educ-Pro Academy ; ou</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">comme déterminé par Educ-Pro Academy à sa seule discrétion.<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><o><span xss=\"removed\"> <br></span></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">3.2 Relation avec les autres utilisateurs<br></span></span></b><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span></b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Les instructeurs n\'ont pas de relation contractuelle directe avec les étudiants, de sorte que les seules informations que vous recevrez sur les étudiants sont celles qui vous seront fournies par le biais de nos plateformes. Vous acceptez de ne pas utiliser les données que vous recevez à d\'autres fins que de fournir vos services à ces étudiants sur la plate-forme Educ-Pro Academy, et de ne pas solliciter de données personnelles supplémentaires ou de stocker les données personnelles des étudiants en dehors de la plate-forme Educ-Pro Academy. Vous acceptez d\'indemniser Educ-Pro Academy contre toute réclamation découlant de votre utilisation des données personnelles des étudiants.<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">3.3 Efforts de lutte contre le piratage<br></span></span></b><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span></b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Nous travaillons en partenariat avec des fournisseurs anti-piratage pour aider à protéger votre contenu contre une utilisation non autorisée. Pour permettre cette protection, vous nommez par la présente Educ-Pro Academy et nos fournisseurs anti-piratage comme vos agents dans le but de faire respecter les droits d\'auteur pour chacun de vos contenus, par le biais de processus d\'avis et de retrait (en vertu des lois applicables sur les droits d\'auteur comme le Digital Millennium Copyright Act) et pour d\'autres efforts visant à faire respecter ces droits. Vous accordez à Educ-Pro Academy et à nos fournisseurs anti-piratage l\'autorité principale pour déposer des avis en votre nom afin de faire valoir vos intérêts en matière de droits d\'auteur.<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\">Vous acceptez qu’Educ-Pro Academy et nos fournisseurs anti-piratage conservent les droits ci-dessus, sauf si vous les révoquez en envoyant un e-mail à  </span><span lang=\"fr\"><a href=\"mailto:topticsolution@gmail.com\" xss=\"removed\"><span xss=\"removed\">topticsolution@gmail.com</span></a></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> avec la ligne d\'objet : \"Révoquer les droits de protection anti-piratage\" à partir de l\'adresse électronique associée à votre compte. Toute révocation des droits sera effective 48 heures après sa réception par nos soins.</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">4. Fixation des prix<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">4.1 Fixation des prix<br></span></span></b><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span></b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Lorsque vous créez un contenu soumis disponible à l\'achat sur Educ-Pro Academy, vous serez invité à fixer un prix de base (\"Prix de base\") pour votre contenu soumis. Vous pouvez également choisir d\'offrir votre contenu soumis gratuitement (exception faite du contenu directement produit par l\'équipe d’Educ-Pro Academy).<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Vous nous autorisez à partager gratuitement votre contenu soumis avec nos employés, avec des partenaires sélectionnés et dans les cas où nous devons faire la restauration des comptes qui ont précédemment acheté votre contenu soumis. Vous comprenez que vous ne recevrez aucune compensation dans ces cas.<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">4.2 Taxes sur les transactions<br></span></span></b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Si un étudiant achète un produit ou un service dans un pays qui exige qu’Educ-Pro Academy remette des taxes de vente ou d\'utilisation nationales, étatiques ou locales, des taxes sur la valeur ajoutée (TVA) ou d\'autres taxes de transaction similaires (\"taxes de transaction\"), en vertu de la loi applicable, nous collecterons et remettrons ces taxes de transaction aux autorités fiscales compétentes pour ces ventes. Nous pouvons augmenter le prix de vente à notre discrétion lorsque nous déterminons que de telles taxes peuvent être dues.<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">4.3 Programmes promotionnels<br></span></span></b><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span></b><span lang=\"fr\" xss=\"removed\">Educ-Pro Academy propose plusieurs programmes marketing facultatifs (programmes promotionnels) auxquels vous pouvez choisir de participer, comme détaillé dans notre </span><span lang=\"fr\"><u><span xss=\"removed\">politique de promotion</span></u></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">. Ces programmes peuvent aider à augmenter vos revenus sur Educ-Pro Academy en trouvant le point de prix optimal pour votre contenu soumis et en les offrant par le biais de collections d\'abonnements.</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Il n\'y a pas de coût initial pour participer à ces programmes, et vous pouvez modifier votre statut de participation à tout moment, bien que les changements que vous faites ne s\'appliquent pas aux campagnes actuellement actives et que certains programmes peuvent avoir des exigences supplémentaires sur la résiliation.<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">5. Paiements<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">5.1 Partage des revenus<br></span></span></b><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span></b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Lorsqu\'un étudiant achète votre contenu soumis, nous calculons le montant brut de la vente comme le montant effectivement reçu par Educ-Pro Academy de la part de l\'étudiant (\"Montant brut\"). Nous en soustrayons les taxes sur les transactions, les frais de service, de production et de traitement  de 9 %, pour calculer le montant net de la vente (\" Montant net \").<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Si vous n\'avez pas opté pour l\'un des programmes promotionnels facultatifs de Educ-Pro Academy, votre part de revenu sera de 50% du montant net. Si nous modifions ce taux de paiement, nous vous en informerons 30 jours à l\'avance par des moyens proéminents, tels qu\'un e-mail ou la publication d\'un avis sur nos plateformes.<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\">Si vous optez pour l\'un des programmes promotionnels, le partage des revenus peut être différent et sera tel que spécifié dans la </span><span lang=\"fr\"><u><span xss=\"removed\">politique de promotion</span></u></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">.</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Educ-Pro Academy effectue tous les paiements d\'instructeurs en FCFA, quelle que soit la devise avec laquelle la vente a été effectuée.<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Educ-Pro Academy n\'est pas responsable des frais de conversion de devises étrangères, des frais de câblage ou de tout autre frais de traitement que vous pourriez encourir. Votre rapport de revenus montrera le prix de vente (en devise locale) et le montant de vos revenus convertis (en FCFA).<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">5.2 Coupons d\'instructeur et liens de parrainage de cours<br></span></span></b><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span></b><span lang=\"fr\" xss=\"removed\">La plate-forme Educ-Pro Academy vous permet de générer des codes de coupon et des liens de référence pour offrir certains éléments de votre contenu soumis aux étudiants avec un rabais, au prix actuel de Educ-Pro Academy, ou gratuitement, comme autorisé dans les services. Ces codes de coupon et liens de référence sont soumis à des limites, et vous ne pouvez pas les vendre sur des sites Web tiers ou les offrir en échange d\'une compensation. Des informations et des restrictions supplémentaires concernant ces codes de réduction et ces liens de parrainage sont décrites dans nos </span><span lang=\"fr\"><u><span xss=\"removed\">politiques de confiance et de sécurité</span></u></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">.</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">5.3 Réception des paiements<br></span></span></b><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span></b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Pour que nous puissions vous payer en temps voulu, vous devez posséder un compte Mobile Money ou bancaire en règle et nous tenir informés de l\'adresse électronique correcte associée à votre compte. Vous devez également fournir toute information d\'identification ou document nécessaire au paiement des montants dus, et vous acceptez que nous ayons le droit de retenir les taxes appropriées sur vos paiements. Nous nous réservons le droit de retenir les paiements ou d\'imposer d\'autres pénalités si nous ne recevons pas de votre part les informations d\'identification ou les documents appropriés. Vous comprenez et acceptez que vous êtes responsable en dernier ressort de tout impôt sur vos revenus.<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">En fonction du modèle de partage des revenus applicable, le paiement sera effectué dans les 7 jours suivant la fin du mois au cours duquel nous recevons les frais pour un cours.<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">En tant qu\'instructeur, il vous incombe de déterminer si vous avez le droit d\'être payé par une entreprise béninoise. Nous nous réservons le droit de ne pas verser les fonds en cas de fraude identifiée, de violation des droits de propriété intellectuelle ou d\'autres violations de la loi.<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Si nous ne pouvons pas régler les fonds sur votre compte de paiement après la période fixée par votre état, pays ou autre autorité gouvernementale dans ses lois sur les biens non réclamés, nous pouvons traiter les fonds qui vous sont dus conformément à nos obligations légales, y compris en soumettant ces fonds à l\'autorité gouvernementale appropriée comme l\'exige la loi.<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">6. Marques déposées<br></span></span></b><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span></b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Tant que vous êtes un instructeur publié et sous réserve des exigences ci-dessous, vous pouvez utiliser nos marques commerciales lorsque nous vous y autorisons.<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Vous devez :<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">●</span><span xss=\"removed\">     </span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Utiliser nos marques déposées uniquement dans le cadre de la promotion et de la vente de votre contenu soumis disponible sur Educ-Pro Academy ou de votre participation à Educ-Pro Academy</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">●</span><span xss=\"removed\">     </span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Se conformer immédiatement si nous vous demandons de cesser l\'utilisation.</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Vous ne devez pas :<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">●</span><span xss=\"removed\">     </span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Utiliser nos marques commerciales d\'une manière trompeuse ou dénigrante ;</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">●</span><span xss=\"removed\">     </span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Utiliser nos marques commerciales d\'une manière qui implique que nous soutenons, parrainons ou approuvons votre contenu soumis ou vos services ; ou</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">●</span><span xss=\"removed\">     </span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Utiliser nos marques d\'une manière qui viole la loi applicable ou en relation avec un sujet ou un matériel obscène, indécent ou illégal.</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">7. Suppression de votre compte<br></span></span></b><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span></b><span lang=\"fr\" xss=\"removed\">Des instructions sur la manière de supprimer votre compte d\'instructeur sont disponibles </span><span lang=\"fr\"><u><span xss=\"removed\">ici</span></u></span><span lang=\"fr\" xss=\"removed\">. Nous ferons tous les efforts commercialement raisonnables pour effectuer tous les paiements prévus qui vous sont dus avant de supprimer votre compte. Vous comprenez que si des étudiants se sont précédemment inscrits à votre contenu soumis, votre nom et ce contenu soumis peuvent rester accessibles à ces étudiants après la suppression de votre compte. Si vous avez besoin d\'aide ou rencontrez des difficultés pour supprimer votre compte, vous pouvez nous contacter via notre </span><span lang=\"fr\"><u><span xss=\"removed\">centre d\'assistance</span></u></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">.</span><br><o></o></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">8. Conditions juridiques diverses<br></span></span><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span></b><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">8.1 Mise à jour des présentes conditions<br></span></span></b><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span></b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">De temps à autre, nous pouvons mettre à jour ces conditions pour clarifier nos pratiques ou pour refléter des pratiques nouvelles ou différentes (comme lorsque nous ajoutons de nouvelles fonctionnalités), et Educ-Pro Academy se réserve le droit, à sa seule discrétion, de modifier et/ou d\'apporter des changements à ces conditions à tout moment. Si nous apportons des modifications importantes, nous vous en informerons par des moyens proéminents tels qu\'un avis par courriel envoyé à l\'adresse électronique spécifiée dans votre compte ou en publiant un avis sur nos plateformes. Les modifications prendront effet le jour de leur publication, sauf indication contraire.<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Votre utilisation continue de nos services après l\'entrée en vigueur des modifications signifie que vous acceptez ces modifications. Toutes les Conditions révisées remplacent toutes les Conditions précédentes.<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">8.2 Traductions<br></span></span></b><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span></b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Toute version des présentes Conditions dans une langue autre que le français est fournie pour des raisons de commodité et vous comprenez et acceptez que la langue française prévaudra en cas de conflit.<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span></b><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">8.3 Survie<br></span></span></b><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span></b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">Les sections suivantes survivront à l\'expiration ou à la résiliation des présentes conditions : Sections 2 (Licence à Educ-Pro Academy), 3.3 (Relations avec les autres utilisateurs), 5.3 (Réception des paiements), 5.4 (Remboursements), 7 (Suppression de votre compte), et 8 (Conditions juridiques diverses).<br></span></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">9. Comment nous contacter<br></span></span></b><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\"> <br></span></span><span lang=\"fr\" xss=\"removed\">La meilleure façon d\'entrer en contact avec nous est de contacter notre </span><span lang=\"fr\"><u><span xss=\"removed\">équipe d\'assistance</span></u></span><span lang=\"fr\" xss=\"removed\"><span xss=\"removed\">. Nous serions ravis de connaître vos questions, vos préoccupations et vos commentaires sur nos services.</span><o></o></span></h5><h1 xss=\"removed\"><span xss=\"removed\"><br></span></h1>'),(11,'privacy_policy','<p></p><p></p><p></p><h2><span xss=removed>Politique de confidentialité</span><br></h2><span xss=\"removed\"> Educ-pro Academy peut être amenée à traiter les données à caractère personnel (les « Données ») des internautes visitant le Site (ou « vous »). Nous plaçons la protection des Données au cœur de nos préoccupations et cette Politique de protection des données nous permet de vous informer sur les traitements que nous mettons en œuvre, dans le respect de l’ensemble des réglementations.</span><p></p><h2 class=\"MyMoocApp-MuiBox-root MyMoocApp-jss190 MyMoocApp-jss95 MyMoocApp-jss109\" xss=\"removed\">1. Objectifs des traitements de données</h2><div class=\"MyMoocApp-MuiBox-root MyMoocApp-jss191\" xss=\"removed\"><p xss=\"removed\"><span xss=\"removed\">Vos Données sont uniquement traitées pour :</span></p><ul xss=\"removed\"><li xss=\"removed\"><p xss=\"removed\">Créer votre compte et vous connecter ;</p></li><li xss=\"removed\"><p xss=\"removed\">Répondre à vos demandes de contact et à vos interrogations ;</p></li><li xss=\"removed\"><p xss=\"removed\">Héberger vos Données ;</p></li><li xss=\"removed\"><p xss=\"removed\">Améliorer nos services et les fonctionnalités du Site ;</p></li><li xss=\"removed\"><p xss=\"removed\">Assurer la sécurité du Site ;</p></li><li xss=\"removed\"><p xss=\"removed\">Garantir l’exercice de vos droits et la défense de nos droits ;</p></li><li xss=\"removed\"><p xss=\"removed\">Analyser les statistiques d’utilisation du Site.</p></li></ul><p xss=\"removed\"> Nous traitons vos Données (i) avec votre consentement, que vous pouvez retirer à tout moment ; (ii) lorsqu’elles sont nécessaires à la fourniture de nos services ou pour répondre à vos demandes ; (iii) lorsqu’elles nous permettent de respecter une obligation légale à laquelle nous sommes soumis ; (iv) pour assurer nos intérêts légitimes relatifs à la sécurité du Site, son bon fonctionnement et pour vous envoyer des communications par email.</p><h2 class=\"MyMoocApp-MuiBox-root MyMoocApp-jss193 MyMoocApp-jss95 MyMoocApp-jss109\" xss=\"removed\">2. Données traitées</h2><div class=\"MyMoocApp-MuiBox-root MyMoocApp-jss194\" xss=\"removed\"><p xss=\"removed\">Seules les Données strictement nécessaires à la réalisation des objectifs précisés ci-dessus sont traitées. Ces Données sont collectées directement auprès de vous lors de votre demande de contact ou au cours de l’utilisation du Site (identité, coordonnées, contenus que vous regardez, données de connexion, données issues des cookies techniques ou traceurs avec votre consentement, préférences, types de demandes et toutes autres informations que vous nous communiquez sur les formulaires de collecte du Site).</p><p xss=\"removed\">Dès que cela est nécessaire, nous vous remercions de bien vouloir mettre à jour vos Données.</p><p xss=\"removed\"><br></p><h2 class=\"MyMoocApp-MuiBox-root MyMoocApp-jss196 MyMoocApp-jss95 MyMoocApp-jss109\" xss=\"removed\">3. Destinataires des données</h2><div class=\"MyMoocApp-MuiBox-root MyMoocApp-jss197\" xss=\"removed\"><p xss=\"removed\">Nous ne transmettons vos Données qu’à nos sous-traitants et partenaires lorsque cela est nécessaire pour à la réalisation d’un des objectifs mentionnés ci-dessus. Votre nom peut être partagé avec les autres utilisateurs du Site lorsque vous recommandez un contenu. Enfin, vos Données sont susceptibles d’être transmises à des tiers légalement habilités à y accéder sur requête spécifique, dans certains cas prévus par la loi : autorité judiciaire, autorité administrative, etc. Vos Données pourront également être communiquées à des tiers si cela est nécessaire pour protéger et/ou défendre nos droits, pour faire respecter les présentes dispositions.</p><p xss=\"removed\"><br></p><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Lorsque vous créez un compte et utilisez les Services, y compris par le biais d\'une plateforme tierce, nous collectons toutes les données que vous fournissez directement, y compris :</span></p><div dir=\"ltr\" xss=\"removed\" align=\"left\"><table xss=\"removed\"><colgroup><col width=\"169\"><col width=\"678\"></colgroup><tbody><tr xss=\"removed\"><td xss=\"removed\"><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Données du compte</span></p></td><td xss=\"removed\"><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Pour utiliser certaines fonctionnalités (comme l\'accès au contenu), vous devez créer un compte utilisateur, ce qui nous oblige à collecter et à stocker votre adresse électronique, votre mot de passe et les paramètres de votre compte. Pour créer un compte d\'instructeur, nous recueillons et stockons votre nom, votre adresse électronique, votre mot de passe et les paramètres de votre compte. Lorsque vous utilisez certaines fonctions du site, vous pouvez être invité à fournir des informations supplémentaires, notamment votre profession, des informations sur votre carte d\'identité officielle, une photo de vérification, votre date de naissance, votre race/ethnicité, vos centres d\'intérêt et votre numéro de téléphone. Lors de la création du compte, nous vous attribuons un numéro d\'identification unique.</span></p></td></tr><tr xss=\"removed\"><td xss=\"removed\"><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Données de profil</span></p></td><td xss=\"removed\"><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Vous pouvez également choisir de fournir des informations de profil comme une photo, un titre, une biographie, une langue, un lien vers un site Web, des profils de médias sociaux, un pays ou d\'autres données. Vos données de profil seront accessibles au public par d\'autres personnes.</span></p></td></tr><tr xss=\"removed\"><td xss=\"removed\"><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Contenu partagé</span></p></td><td xss=\"removed\"><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Certaines parties des services vous permettent d\'interagir avec d\'autres utilisateurs ou de partager du contenu publiquement, notamment en publiant des commentaires sur le contenu, en posant des questions ou en y répondant, en envoyant des messages aux étudiants ou aux instructeurs, ou en publiant des photos ou d\'autres travaux que vous téléchargez. Ce contenu partagé peut être visible publiquement par d\'autres personnes en fonction de l\'endroit où il est publié.</span></p></td></tr><tr xss=\"removed\"><td xss=\"removed\"><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Données sur le contenu éducatif</span></p></td><td xss=\"removed\"><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Lorsque vous accédez à un contenu, nous recueillons certaines données, notamment les cours, les devoirs, les laboratoires, les espaces de travail et les quiz que vous avez commencés et terminés, les achats de contenu et les crédits, les abonnements, les certificats d\'achèvement, vos échanges avec les instructeurs, les assistants d\'enseignement et les autres étudiants, ainsi que les essais, les réponses aux questions et les autres éléments soumis pour satisfaire aux exigences des cours et des contenus connexes. Si vous êtes un instructeur, nous stockons votre contenu pédagogique qui peut contenir des données vous concernant.</span></p></td></tr><tr xss=\"removed\"><td xss=\"removed\"><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Données sur le paiement des étudiants</span></p></td><td xss=\"removed\"><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Si vous effectuez des achats, nous recueillons certaines données relatives à votre achat (telles que votre nom, votre adresse de facturation et votre code postal) dans la mesure où elles sont nécessaires au traitement de votre commande et peuvent être enregistrées de manière facultative pour traiter des commandes futures. Vous devez fournir certaines données de paiement et de facturation directement à nos prestataires de services de paiement, notamment votre nom, les informations relatives à votre carte de crédit, l\'adresse de facturation et le code postal. Nous pouvons également recevoir des informations limitées, comme le fait que vous ayez une nouvelle carte et les quatre derniers chiffres de cette carte, de la part des fournisseurs de services de paiement pour faciliter les paiements. Pour des raisons de sécurité, Educ-Pro Academy ne recueille ni ne stocke les données sensibles des titulaires de cartes, telles que les numéros complets de cartes de crédit ou les données d\'authentification des cartes.</span></p></td></tr><tr xss=\"removed\"><td xss=\"removed\"><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Données de paiement des instructeurs</span></p></td><td xss=\"removed\"><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Si vous êtes un instructeur, vous pouvez lier votre compte de paiement PayPal, ou autre aux Services pour recevoir des paiements. Lorsque vous liez un compte de paiement, nous recueillons et utilisons certaines informations, notamment l\'adresse électronique de votre compte de paiement, l\'identifiant de votre compte, votre adresse physique ou d\'autres données nécessaires à l\'envoi de paiements sur votre compte.  Pour des raisons de sécurité, Educ-Pro Academy ne recueille ni ne stocke aucune information bancaire sensible. La collecte, l\'utilisation et la divulgation de vos données de paiement, de facturation et d\'imposition sont soumises à la politique de confidentialité et aux autres conditions de votre fournisseur de compte de paiement.</span></p></td></tr><tr xss=\"removed\"><td xss=\"removed\"><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Données concernant vos comptes sur d\'autres services</span></p></td><td xss=\"removed\"><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Nous pouvons obtenir certaines informations via vos médias sociaux ou d\'autres comptes en ligne s\'ils sont connectés à votre compte Educ-Pro Academy. Si vous vous connectez à Educ-Pro Academy via Facebook ou une autre plateforme ou service tiers, nous vous demandons la permission d\'accéder à certaines informations concernant cet autre compte. Par exemple, selon la plateforme ou le service, nous pouvons recueillir votre nom, votre photo de profil, votre numéro d\'identification de compte, votre adresse électronique de connexion, votre localisation, l\'emplacement physique de vos dispositifs d\'accès, votre sexe, votre date d\'anniversaire et votre liste d\'amis ou de contacts.</span></p><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Ces plateformes et services mettent des informations à notre disposition par le biais de leurs API. Les informations que nous recevons dépendent des informations que vous (via vos paramètres de confidentialité) ou la plateforme ou le service décidez de nous donner.</span></p><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Si vous accédez à nos Services ou les utilisez par le biais d\'une plateforme ou d\'un service tiers, ou si vous cliquez sur des liens tiers, la collecte, l\'utilisation et le partage de vos données seront également soumis aux politiques de confidentialité et autres accords de ce tiers.</span></p></td></tr><tr xss=\"removed\"><td xss=\"removed\"><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Sweepstakes, promotions et sondages</span></p></td><td xss=\"removed\"><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Nous pouvons vous inviter à répondre à une enquête ou à participer à une promotion (comme un concours, une loterie ou un challenge), soit par le biais des Services, soit par le biais d\'une plateforme tierce. Si vous participez, nous collecterons et stockerons les données que vous fournissez dans le cadre de votre participation, telles que votre nom, votre adresse électronique, votre adresse postale, votre date de naissance ou votre numéro de téléphone. Ces données sont soumises à la présente politique de confidentialité, sauf indication contraire dans le règlement officiel de la promotion ou dans une autre politique de confidentialité. Les données collectées seront utilisées pour gérer la promotion ou l\'enquête, notamment pour informer les gagnants et distribuer les récompenses. Pour recevoir une récompense, il peut vous être demandé de nous autoriser à publier certaines de vos informations (par exemple sur la page d\'un gagnant). Lorsque nous utilisons une plate-forme tierce pour gérer une enquête ou une promotion, la politique de confidentialité de cette tierce partie s\'applique.</span></p></td></tr><tr xss=\"removed\"><td xss=\"removed\"><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Communications et soutien</span></p></td><td xss=\"removed\"><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Si vous nous contactez pour obtenir de l\'aide ou pour signaler un problème ou une préoccupation (que vous ayez ou non créé un compte), nous recueillons et stockons vos coordonnées, vos messages et d\'autres données vous concernant comme votre nom, votre adresse électronique, vos messages, votre localisation, votre identifiant d\'utilisateur Educ-Pro Academy, vos identifiants de transaction de remboursement et toute autre donnée que vous fournissez ou que nous recueillons par des moyens automatisés (que nous couvrons ci-dessous). Nous utilisons ces données pour vous répondre et rechercher votre question ou préoccupation, conformément à la présente politique de confidentialité.</span></p></td></tr></tbody></table></div><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Les données énumérées ci-dessus sont stockées par nous et associées à votre compte.</span></p><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">- Données que nous recueillons par des moyens automatisés</span></p><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Lorsque vous accédez aux services (y compris le contenu de navigation), nous recueillons certaines données par des moyens automatisés, notamment :</span></p><p xss=\"removed\"><span id=\"docs-internal-guid-c27c024a-7fff-7315-b81d-0c3c03e081a1\"></span></p><div dir=\"ltr\" xss=\"removed\" align=\"left\"><table xss=\"removed\"><colgroup><col width=\"169\"><col width=\"678\"></colgroup><tbody><tr xss=\"removed\"><td xss=\"removed\"><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Données du système</span></p></td><td xss=\"removed\"><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Les données techniques concernant votre ordinateur ou votre appareil, comme votre adresse IP, le type d\'appareil, le type et la version du système d\'exploitation, les identifiants uniques de l\'appareil, le navigateur, la langue du navigateur, le domaine et les autres données du système, ainsi que les types de plate-forme.</span></p></td></tr><tr xss=\"removed\"><td xss=\"removed\"><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Données d\'utilisation</span></p></td><td xss=\"removed\"><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Statistiques d\'utilisation concernant vos interactions avec les services, y compris le contenu consulté, le temps passé sur les pages ou le service, les pages visitées, les fonctions utilisées, vos requêtes de recherche, les données relatives aux clics, la date et l\'heure, le référent et d\'autres données concernant votre utilisation des services.</span></p></td></tr><tr xss=\"removed\"><td xss=\"removed\"><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Données géographiques approximatives</span></p></td><td xss=\"removed\"><p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Une localisation géographique approximative, comprenant des informations telles que le pays, la ville et les coordonnées géographiques, calculée sur la base de votre adresse IP.</span></p></td></tr></tbody></table></div></div></div></div><p><br></p>'),(13,'theme','default'),(14,'cookie_note','Ce site utilise des cookies pour personnaliser le contenu et analyser le trafic afin de vous offrir une meilleure expérience.'),(15,'cookie_status','active'),(16,'cookie_policy','<h1>Politique des cookies</h1><ol><li><h2 class=\"MyMoocApp-MuiBox-root MyMoocApp-jss426 MyMoocApp-jss95 MyMoocApp-jss109\" xss=removed><br></h2><h2 class=\"MyMoocApp-MuiBox-root MyMoocApp-jss426 MyMoocApp-jss95 MyMoocApp-jss109\" xss=removed>1. Définition d’un cookie</h2><div class=\"MyMoocApp-MuiBox-root MyMoocApp-jss427\" xss=removed><p xss=removed>Un cookie est un fichier texte susceptible d’être déposé sur votre terminal (ordinateur, tablette, téléphone, smartphone, etc.) lors de la consultation d’un service en ligne grâce à un logiciel de navigation. Un cookie permet à son émetteur de collecter ou d’inscrire des informations sur votre terminal pendant sa durée de validité. Les cookies permettent par exemple de reconnaître votre terminal à chaque fois que vous l’utilisez pour accéder à un service en ligne contenant des cookies du même émetteur. Les « cookies » mentionnés dans la présente Politique font également référence à d\'autres moyens d\'accéder à ou de stocker automatiquement des informations sur votre terminal. </p><h2 class=\"MyMoocApp-MuiBox-root MyMoocApp-jss429 MyMoocApp-jss95 MyMoocApp-jss109\" xss=removed>2. Les cookies que nous utilisons</h2><div class=\"MyMoocApp-MuiBox-root MyMoocApp-jss430\" xss=removed><p xss=removed>Lorsque vous accédez au Site, un bandeau « cookies » apparaît pour vous informer sur le dépôt de cookies et obtenir votre consentement lorsqu’il est nécessaire. Nous utilisons deux grandes catégories de cookies :</p><p xss=removed></p><ul xss=removed><li xss=removed><p xss=removed><span xss=removed>Cookies strictement techniques : </span>ils sont nécessaires au fonctionnement du Site, ils sont toujours déposés sur votre terminal et ne nécessitent pas votre consentement ;</p></li><li xss=removed><p xss=removed><span xss=removed>Cookies non techniques : </span>ils peuvent être déposés sur votre terminal lorsque vous y avez consenti. Votre consentement est la base légale du traitement de vos données collectées à partir de ces cookies. Vous pouvez retirer votre consentement à tout moment depuis le point 3 de la présente Politique « Paramétrage des cookies ».</p></li></ul></div></div></li></ol>'),(17,'banner_image','61a503752c569b478fb36a5427e14afa.jpg'),(18,'light_logo','logo-light.png'),(19,'dark_logo','14c4f36143b4b09cbc320d7c95a50ee7.png'),(20,'small_logo','662a151f5da6058a83f78d6d2206ecbd.png'),(21,'favicon','ead8e65817265dd1346c3d2b2ba251c5.png'),(22,'recaptcha_status','0'),(23,'recaptcha_secretkey','6LfM91wfAAAAAISR-bV2wPhGmAShjnsCe0kts9TQkey'),(24,'recaptcha_sitekey',' educproacademy.com');
