INSERT INTO `lesson` VALUES (1,'Les bases d&#039;Excel','00:11:03',2,2,'system','http://localhost/Academy-LMS/uploads/lesson_files/videos/d69f5cbcdde246036c3c8ad888bca788.mp4',1638748800,1638748800,'video',NULL,'file','Pour ce premier cours consacré à l’apprentissage du tableur Excel, nous allons découvrir ensemble les bases qu’il est nécessaire de maîtriser pour réaliser ses propres fichiers de travail, sans que la moindre connaissance ne soit requise. Nous allons ainsi découvrir l’interface d’Excel, puis nous allons voir comment construire notre premier tableau contenant des données avec une formule basic et une mise-en-forme elle aussi très sommaire.',0,'html5','http://localhost/Academy-LMS/uploads/lesson_files/videos/d69f5cbcdde246036c3c8ad888bca788.mp4','00:11:03'),(3,'Le menu Ruban','00:02:24',2,2,'system','http://localhost/Academy-LMS/uploads/lesson_files/videos/840e70f9716ee1e02d9296c329aa0551.mp4',1638748800,NULL,'video',NULL,'file','Le menu Ruban',0,'html5','http://localhost/Academy-LMS/uploads/lesson_files/videos/840e70f9716ee1e02d9296c329aa0551.mp4','00:02:24'),(4,'LES BASES &amp; PREREQUIS','00:09:20',3,3,'system','http://localhost/Academy-LMS/uploads/lesson_files/videos/6ddd5ce8c5faeab3152a49b5dbc6314a.mp4',1638835200,1638835200,'video',NULL,'file','Comment apprendre le java\r\n00:00 - Introduction\r\n2:19 - Installation d\'eclipse\r\n3:04 - Installation JDK\r\n3:30 - Mise en place\r\n4:43 - Lancement du logiciel\r\n6:50 - Premier projet\r\n9:20 - Premiers code\r\n\r\nEclipse : http://graven.yt/eclipse\r\nSpigot: https://getbukkit.org\r\nJava : http://java.com/fr/\r\nJava Développement Kit (JDK) : http://graven.yt/jdk\r\n',0,'html5','http://localhost/Academy-LMS/uploads/lesson_files/videos/6ddd5ce8c5faeab3152a49b5dbc6314a.mp4','00:09:20'),(5,'LES VARIABLES','00:05:45',3,3,'system','http://localhost/Academy-LMS/uploads/lesson_files/videos/9fe58ff8ac5e2f11fa0720882f3b7a9b.mp4',1638835200,NULL,'video',NULL,'file',' la notion de variable\r\n\r\nLes Doubles