,'00:01:57',5,13,'YouTube','https://www.youtube.com/watch?v=S5rugaeSaYI&amp;list=PLlIcksHGcYW2-IdKFYQ_nvmFNKF-tyo2W&amp;index=29',1639872000,NULL,'video',NULL,'url','',0,'html5','https://www.html5rocks.com/en/tutorials/video/basics/devstories.webm','00:01:10'),(68,' Décaler les observations avec lead &amp; lag - dplyr','00:02:34',5,13,'YouTube','https://www.youtube.com/watch?v=S-elws9vXhA&amp;list=PLlIcksHGcYW2-IdKFYQ_nvmFNKF-tyo2W&amp;index=30',1639872000,NULL,'video',NULL,'url','',0,'html5','https://www.html5rocks.com/en/tutorials/video/basics/devstories.webm','00:01:10'),(69,'Récurrence - Démontrer une égalité','00:07:43',7,15,'YouTube','https://www.youtube.com/watch?v=EFuRMKplFZw&amp;list=PLSOFOcyBRpIjyUy8nLbcLuyc2NhD8izXv',1652140800,NULL,'video',NULL,'url','Comment démontrer une égalité à l\'aide du raisonnement par récurrence ?\r\nComment montrer qu\'une égalité est vrai pour tout entier n appartenant à N ?\r\n\r\nCette vidéo répond à ces questions et à d\'autres, notamment :\r\n\r\n- Comment rédiger une démonstration par récurrence ?\r\n- Comment démontrer une égalité par récurrence ?\r\n- Que signifie Hypothèse de Récurrence ?\r\n- Que signifie Conclusion de Récurrence ?\r\n\r\nLa démonstration par récurrence se retrouve suite à des questions du type :\r\n• Montrer une égalité par récurrence.\r\n• Montrer une inégalité par récurrence.\r\n• Montrer qu’une suite est majorée/minorée par récurrence.\r\n• Etudier la monotonie d’une suite par récurrence.\r\n',0,'html5','https://www.youtube.com/watch?v=EFuRMKplFZw&list=PLSOFOcyBRpIjyUy8nLbcLuyc2NhD8izXv','00:07:49'),(70,'Récurrence - Démontrer une inégalité','00:04:07',7,15,'YouTube','https://www.youtube.com/watch?v=jMdkoxzCg-0&amp;list=PLSOFOcyBRpIjyUy8nLbcLuyc2NhD8izXv&amp;index=2',1652140800,NULL,'video',NULL,'url','Cette vidéo répond à cette question et à d\'autres notamment :\r\n- Comment rédiger une démonstration par récurrence ?\r\n- Comment démontrer une égalité par récurrence ?\r\n- Que signifie Hypothèse de Récurrence ?\r\n- Que signifie Conclusion de Récurrence ?\r\n\r\nLa démonstration par récurrence se retrouve suite à des questions du type :\r\n• Montrer une égalité par récurrence.\r\n• Montrer une inégalité par récurrence.\r\n• Montrer qu’une suite est majorée/minorée par récurrence.\r\n• Etudier la monotonie d’une suite par récurrence.\r\n',0,'html5','https://www.youtube.com/watch?v=jMdkoxzCg-0&list=PLSOFOcyBRpIjyUy8nLbcLuyc2NhD8izXv&index=2','00:00:00'),(71,'Récurrence - Démontrer une conjecture','00:08:17',7,15,'YouTube','https://www.youtube.com/watch?v=SsOZq1gYXA4&amp;list=PLSOFOcyBRpIjyUy8nLbcLuyc2NhD8izXv&amp;index=3',1652140800,NULL,'video',NULL,'url','Qu\'est-ce qu\'une conjecture ?\r\nComment émettre une conjecture ?\r\nComment démontrer une conjecture par récurrence ?\r\n\r\nCette vidéo répond à ces questions et à d\'autres, notamment :\r\n\r\nA quoi sert un raisonnement par récurrence ?\r\n- Comment rédiger une démonstration par récurrence ?\r\n- Quelle est la rédaction attendue le jour du Bac ?\r\n- Comment démontrer une égalité par récurrence ?\r\n- Que signifie Hypothèse de Récurrence ?\r\n- Que signifie Conclusion de Récurrence ?\r\n\r\nLa démonstration par récurrence se retrouve suite à des questions du type :\r\n• Montrer une égalité par récurrence sur N.\r\n• Montrer une inégalité par récurrence sur N.\r\n• Montrer qu’une suite est majorée/minorée par récurrence.\r\n• Etudier la monotonie d’une suite par récurrence.',0,'html5','https://www.youtube.com/watch?v=SsOZq1gYXA4&list=PLSOFOcyBRpIjyUy8nLbcLuyc2NhD8izXv&index=3','00:00:00'),(72,'Récurrence - Démontrer une inégalité avec les suites','00:04:26',7,15,'YouTube','https://www.youtube.com/watch?v=Ba_UkqvEULI&amp;list=PLSOFOcyBRpIjyUy8nLbcLuyc2NhD8izXv&amp;index=4',1652140800,NULL,'video',NULL,'url','Cette vidéo répond à cette question et à d\'autres notamment :\r\n- Comment rédiger une démonstration par récurrence ?\r\n- Comment démontrer une égalité par récurrence ?\r\n- Que signifie Hypothèse de Récurrence ?\r\n- Que signifie Conclusion de Récurrence ?\r\n\r\nLa démonstration par récurrence se retrouve suite à des questions du type :\r\n• Montrer une égalité par récurrence.\r\n• Montrer une inégalité par récurrence.\r\n• Montrer qu’une suite est majorée/minorée par récurrence.\r\n• Etudier la monotonie d’une suite par récurrence.\r\n',0,'html5','https://www.youtube.com/watch?v=Ba_UkqvEULI&list=PLSOFOcyBRpIjyUy8nLbcLuyc2NhD8izXv&index=4','00:00:00'),(73,'Correction complète d&#039;un sujet du bac S sur la récurrence','00:17:10',7,15,'YouTube','https://www.youtube.com/watch?v=UlUrYrB2xPU&amp;list=PLSOFOcyBRpIjyUy8nLbcLuyc2NhD8izXv&amp;index=5',1652140800,NULL,'video',NULL,'url','Cette vidéo répond à cette question et à d\'autres notamment :\r\n- Comment rédiger une démonstration par récurrence ?\r\n- Comment démontrer une égalité par récurrence ?\r\n- Que signifie Hypothèse de Récurrence ?\r\n- Que signifie Conclusion de Récurrence ?\r\n\r\nLa démonstration par récurrence se retrouve suite à des questions du type :\r\n• Montrer une égalité par récurrence.\r\n• Montrer une inégalité par récurrence.\r\n• Montrer qu’une suite est majorée/minorée par récurrence.\r\n• Etudier la monotonie d’une suite par récurrence.',0,'html5','https://www.youtube.com/watch?v=UlUrYrB2xPU&list=PLSOFOcyBRpIjyUy8nLbcLuyc2NhD8izXv&index=5','00:00:00');
